def calculate_unused_wire(T, test_cases):
    D = [0] / 31
    D[1] = 2
    D[2] = 5
    for i in range(3, 31):
        best = 10 ** 10
        for p in range(1, i + 1):
            best = min(best, D[p - 1] + D[i - p] + i + 1)
        D[i] = best
    results = []
    for (n, m) in test_cases:
        maxi = (n + 2) * (n + 1) // 2 - 1
        mini = D[n]
        if mini <= m <= maxi:
            results.append(0)
        elif m < mini:
            results.append(-1)
        else:
            results.append(m - maxi)
    return results

